import React, { useEffect } from 'react';
import { useSelector, useDispatch } from 'react-redux';
import DefaultLayout from '../DefualtLayout';
import { getAllCars } from '../../redux/Actions/carsActions';
import { Col, Row, Button } from 'antd';
import { Link } from 'react-router-dom';
import Spinner from '../Spinner';
import './CarSection.css';

const CarSection = () => {
  const dispatch = useDispatch();

  // State for the cars data and error message
  const cars = useSelector((state) => state.cars.cars);
  const carErrorMessage = useSelector((state) => state.cars.errorMessage);

  // Fetch all cars on component mount
  useEffect(() => {
    dispatch(getAllCars());
  }, [dispatch]);

  return (
    <div className='Home'>
      <DefaultLayout>
        {carErrorMessage && <div>Error: {carErrorMessage}</div>}
        {cars.length === 0 ? (
          <Spinner />
        ) : (
          <Row justify='center' gutter={16}>
            {cars.map((car) => (
              <Col key={car._id} lg={5} sm={24} xs={24}>
                <div className='car p-2 bs1'>
                  <img src={car.image} alt={car.name} className='carimg' />

                  <div className='car-content d-flex align-items-center justify-content-between'>
                    <div className='text-left pl-2'>
                      <p>{car.name}</p>
                      <p>Rent Per Hour {car.rentPerHour} /-</p>
                    </div>

                    <div>
                      <Button type='primary' className='btn1 mr-2'>
                  
                      </Button>
                    </div>
                  </div>
                </div>
              </Col>
            ))}
          </Row>
        )}
      </DefaultLayout>
    </div>
  );
};

export default CarSection;
